import React, { useEffect, useState } from 'react';
import Nav from '../components/Nav';
import Body from '../components/Body';
import PageWrapper from '../components/PageWrapper';

export default function HomePage() {
	const [foodImage, setFoodImage] = useState(
		'http://www.wok88.se/foto/bild1.jpg',
	);

	useEffect(() => {
		setInterval(imageRotate(), 3000);
	}, [foodImage]);

	function imageRotate(): string {
		let foodNumber = Math.floor(Math.random() * 9);
		return `http://www.wok88.se/foto/bild${foodNumber}.jpg`;
	}

	return (
		<PageWrapper>
			<div>
				<Nav />
				<Body>
					<div>
						<h2>Öppettider</h2>
						<h4>Måndag Stängt</h4>
					</div>
					<img src={foodImage} alt="food stuff in this one" />
				</Body>
				<style jsx>{`
					background: gold;
					display: flex;
					flex-direction: column;
					margin: auto;
				`}</style>
			</div>
		</PageWrapper>
	);
}

